.home {
    position: absolute;
    top: 0px;
    left: 0px;
    width: 100%;
    height: 100%;
    margin: 0px;
    padding: 0px;
    overflow-y: auto;
    text-align: center;
    transition-duration: 0.3s;
    transition-timing-function: ease-in-out;
    background: linear-gradient(to top right, rgb(19, 107, 196), rgb(143, 180, 250), rgba(253, 209, 250, 0.7), white);
}

.title {
    position: relative;
    top: 5vh;
    color: white;
    cursor: default;
    font-size: 5vmax;
    font-weight: 500;
    user-select: none;
    font-family: 'Avenir';
}

.underline-field {
    position: relative;
    width: 45rem;
    border: none;
    color: white;
    display: block;
    font-weight: 200;
    background: none;
    font-family: 'Avenir';
    border-bottom: 1px solid white;
}

.home-login-fields {
    position: relative;
    top: 10%;
}
.home-login-fields > input {
    height: 50px;
    font-size: 2rem;
    font-weight: 200;
    margin-bottom: 9vh;
}
.home-login-fields > * {
    position: relative;
    margin-left: auto;
    margin-right: auto;
    font-family: 'Avenir';
}
.home-login-fields > *::placeholder {
    color: white;
}
